import React, {Component} from 'react';

class MandalArtTable extends Component{
    state={
        aa:'',
        ab:'',
        ac:'',
        ba:'',
        bb:'',
        bc:'',
        ca:'',
        cb:'',
        cc:'',

    }
    handleChange=(e)=>{
        this.setState({
            aa:this.state.aa,
            ab:this.state.ab,
            ac:this.state.ac,
            ba:this.state.ba,
            bb:this.state.bb,
            bc:this.state.bc,
            ca:this.state.ca,
            cb:this.state.cb,
            cc:this.state.cc,
            [e.target.name]: e.target.value
        });
    }

    render() {
        return (
            <table>
                <tr>
                    <td><input value={this.state.aa} onChange={this.handleChange}/></td>
                    <td><input value={this.state.aa} onChange={this.handleChange}/></td>
                    <td><input value={this.state.aa} onChange={this.handleChange}/></td>
                </tr>
                <tr>
                    <td><input value={this.state.aa} onChange={this.handleChange}/></td>
                    <td><input value={this.state.aa} onChange={this.handleChange}/></td>
                    <td><input value={this.state.aa} onChange={this.handleChange}/></td>
                </tr>
                <tr>
                    <td><input value={this.state.aa} onChange={this.handleChange}/></td>
                    <td><input value={this.state.aa} onChange={this.handleChange}/></td>
                    <td><input value={this.state.aa} onChange={this.handleChange}/></td>
                </tr>
            </table>
        );
    };
};

export default MandalArtTable;
